Ext.data.JsonP['Dashboard_4.13.1_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Dashboard 4.13.1 - 14 August 2017</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p>\n\t\t</div>\n        <div class=\"header\"/>\n\n        <div id=\"src-50726602\" class=\"content\">\n                        <h1>Dashboard 4.13.1 - 14 August 2017</h1>\n    <p>Dashboard 4.13.1 is a patch release, which includes several improvements and bug fixes.    </p>\n    <div class=\"section section-2 \" id=\"src-50726602_Dashboard4.13.1ReleaseNote-Improvements\">\n        <h2 class=\"heading \"><span>Improvements</span></h2>\n<ul class=\" \"><li class=\" \">    <p>Revised integrations verbiage on Studio product page    </p>\n</li><li class=\" \">    <p>Added &quot;Technology Preview&quot; verbiage on Query Builder information page    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-50726602_Dashboard4.13.1ReleaseNote-Fixedissues\">\n        <h2 class=\"heading \"><span>Fixed issues</span></h2>\n<ul class=\" \"><li class=\" \">    <p>Fixed issue where analytics data may not be displayed as expected    </p>\n</li><li class=\" \">    <p>Fixed issue where App Preview and Query Builder information pages may not be displayed    </p>\n</li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=50726602\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Dashboard 4.13.1 Release Note"});